sys_variable_value.value:
(function execute(inputs, outputs) {
var dateTime = inputs.dateTime.toString();
  var gdt = new GlideDateTime(dateTime);
  var gdtMS = gdt.getNumericValue();
  outputs.gdtms = Number(gdtMS);
})(inputs, outputs);

